using Xunit;
using Moq;
using NPT.DataAccess.Repository;
using NPT.Model.RequestModel;
using NPT.Model.ResponseModel;
using Microsoft.Extensions.Configuration;

namespace NPTWebApi.Tests.Repository
{
    public class PronunciationRepositoryTests
    {
        private MockRepository mockRepository;
        private string connectionstring;
        public PronunciationRepositoryTests()
        {
            var builder = new ConfigurationBuilder()
               .AddJsonFile("appsettings.json", optional: false, reloadOnChange: true)
               .AddEnvironmentVariables();
            IConfiguration config = builder.Build();
            connectionstring = config.GetValue<string>("ConnectionStrings:NPTContextConnection");
            this.mockRepository = new MockRepository(MockBehavior.Strict);
        }

        private PronunciationRepository CreatePronunciationRepository()
        {
            return new PronunciationRepository();
        }
        [Fact]
        public async void GetUserPronunciationDetails()
        {
            //Arrange
            var pronunciationrepo = this.CreatePronunciationRepository();

            UserPronunciationDetailsRequestModel request = new UserPronunciationDetailsRequestModel();
            UserPronunciationDetailsResponseModel response = new UserPronunciationDetailsResponseModel();
            request.loggedinId = "anilkalwakuntla@wfhackathon2022.onmicrosoft.com";

            //Act
            response = await pronunciationrepo.GetUserPronunciationDetails(request, connectionstring);
            if (response != null)
            {
                //Assert
                Assert.NotNull(response.LoggedinId);
                Assert.NotNull(response.EmployeeId);
                Assert.NotNull(response.Firstname);
                Assert.NotNull(response.Lastname);
                Assert.NotNull(response.Fullname);
                Assert.NotNull(response.Phone);
                Assert.NotNull(response.EmailAddress);
                Assert.NotNull(response.Managername);
                Assert.NotNull(response.lanid);
                Assert.IsType<bool>(response.IsAdmin);
                if (response.IsCustomPronunciationAvailable)
                {
                    Assert.NotNull(response.CustomPronunciation);
                    Assert.IsType<bool>(response.OverrideStandardPronunciation);
                    Assert.NotNull(response.Createdby);
                }

                this.mockRepository.Verify();
            }
        }

        [Fact]
        public async void SaveCustomPronunciation()
        {
            //Arrange
            var pronunciationrepo = this.CreatePronunciationRepository();
            SaveCustomPronunciationRequestModel request = new SaveCustomPronunciationRequestModel();
            SaveCustomPronunciationResponseModel response = new SaveCustomPronunciationResponseModel();

            request.EmployeeId = "2022005";
            request.CustomPronunciationVoiceAsBase64 = "base64,";
            request.Comments = "Comments from Unit Test";
            request.Isupdate = false;
            request.LoggedinId = "rathna.sireesha@wfhackathon2022.onmicrosoft.com";
            request.OverrideStandardPronunciation = true;
           
            //Act
            response = await pronunciationrepo.SaveCustomPronunciation(request, connectionstring);

            //Assert
            if (response != null)
            {
                Assert.IsType<bool>(response.Success);
            }
            this.mockRepository.Verify();
        }

        [Fact]
        public async void UpdateCustomPronunciation()
        {
            //Arrange
            var pronunciationrepo = this.CreatePronunciationRepository();
            SaveCustomPronunciationRequestModel request = new SaveCustomPronunciationRequestModel();
            SaveCustomPronunciationResponseModel response = new SaveCustomPronunciationResponseModel();

            request.EmployeeId = "1818181";
            request.CustomPronunciationVoiceAsBase64 = "base64,";
            request.Comments = "Comments from Unit Test-update";
            request.Isupdate = true;
            request.LoggedinId = "rathna.sireesha@wfhackathon2022.onmicrosoft.com";
            request.OverrideStandardPronunciation = true;

            //Act
            response = await pronunciationrepo.SaveCustomPronunciation(request, connectionstring);

            //Assert
            if (response != null)
            {
                Assert.IsType<bool>(response.Success);
            }
            this.mockRepository.Verify();
        }

        [Fact]
        public async void GetCustompronunciation()
        {
            //Arrange
            var pronunciationrepo = this.CreatePronunciationRepository();
            GetPronunciationRequestmodel request = new GetPronunciationRequestmodel();
            CustomPronunciationResponseModel response = new CustomPronunciationResponseModel();
            request.EmployeeId = "2022001";

            //Act
            response = await pronunciationrepo.GetPronunciation(request, connectionstring);

            //Assert
            if (response != null)
            {
                Assert.NotNull(response.Custompronunciation);
                Assert.IsType<bool>(response.Success);
            }

            this.mockRepository.Verify();
        }

        [Fact]
        public async void DeleteCustomPronunciation()
        {
            //Arrange
            var pronunciationrepo = this.CreatePronunciationRepository();
            DeleteCustomPronunciationRequestModel request = new DeleteCustomPronunciationRequestModel();
            DeleteCustomPronunciationResponseModel response = new DeleteCustomPronunciationResponseModel();
            request.DeletingRecordEmployeeId = "2022003";

            //Act
            response = await pronunciationrepo.DeleteCustomPronunciation(request, connectionstring);

            //Assert
            if (response != null)
            {
                 Assert.IsType<bool>(response.Success);
            }
            this.mockRepository.Verify();
        }

        
    }
}
